function new3DFace(x, y, rx, ry, color) {
    var face = new lively.morphic.Box(rect(0, 0, 50, 50));
    face.applyStyle({enableGrabbing: false, enableDragging: false,
        borderWidth: 2, borderColor: Color.black, fill: color, opacity: 0.9});
    // morphNode tracks rotation

    face.transform3D = new WebKitCSSMatrix;
    face.transform3DBy = function(matrix) {
        this.transform3D = matrix.multiply(this.transform3D);
        this.renderContext().getMorphNode().style.webkitTransform = this.transform3D;
    };
    face.renderContext().getMorphNode().style.webkitTransformStyle = 'preserve-3d';
    face.renderContext().getMorphNode().style.webkitTransition = '-webkit-transform 0.3s';

    // shapeNode has initial rotation and translation
    face.renderContext().getShapeNode().style.webkitTransformStyle = 'preserve-3d';
    face.renderContext().getShapeNode().style.webkitTransform = 
        'translate3d(-25px,-25px,0px) ' +
        'rotateX(' + rx + 'deg) rotateY(' + ry + 'deg) ' +
        'translate3d(' + x*50 + 'px,' + y*50 + 'px,75px)';
    return face;
}

