function new3DCube() {
    var cube = new lively.morphic.Box(rect(200, 200, 0, 0));
    cube.renderContext().getMorphNode().style.webkitPerspective = 500;
    cube.renderContext().getMorphNode().style.webkitTransformStyle = 'preserve-3d';
    cube.renderContext().getShapeNode().style.webkitTransformStyle = 'preserve-3d';
    cube.renderContext().getShapeNode().style.webkitTransform = 'translateZ(200px)';
    [
        {rotX:   0, rotY:   0, color: Color.red},
        {rotX:   0, rotY:  90, color: Color.yellow},
        {rotX:   0, rotY: 180, color: Color.green},
        {rotX:   0, rotY: -90, color: Color.blue},
        {rotX:  90, rotY:   0, color: Color.white},
        {rotX: -90, rotY:   0, color: Color.orange}
    ].forEach(function(each){
        for (var y = -1; y <= 1; y++)
            for (var x = -1; x <= 1; x++) {
                var face = this.new3DFace(x, y, each.rotX, each.rotY, each.color);
                cube.addMorph(face);
            }
    }, this);
    return cube;
}

