function transform3DBy(matrix, faces) {
    if (!matrix) matrix = (new WebKitCSSMatrix).rotate(90,0,0);
    if (!faces) faces = this.cube.submorphs;
    faces.forEach(function(face){
        face.transform3DBy(matrix);
    });
}
